import { Component } from '@angular/core';
import {LoggingService} from "../logging.service";

@Component({
  selector: 'app-users',
  templateUrl: './users.component.html',
  styleUrls: ['./users.component.css']
})
export class UsersComponent {

  constructor(private logSer: LoggingService) {
  }

  public log(){
    this.logSer.log(this.logSer.title);
    this.logSer.log("This is users")
  }
}
<p class="alert alert-info" style="text-align: center;">We are in Users component</p>
<button (click)="log()" class="btn btn-primary">Log in Console</button>
